    fetch("/api")
      .then((res) => res.json())
      .then((data) => {

        setData(data)
      });
  } 
  , []);
  return (
    <div className="App">
              <div className="mask">
            <img className="image" src={Image1} alt="Image1"/>

        </div>
        <div className="content">
            <p> Hi , I am yash darshankar</p>
            <h1>Web Developer</h1>


        </div>
      <br/><br/><br/>
      {!data ? <h1>Loading</h1> :data.map((d,index) => 
        <div className="box">

          <div className="box_index">{index}.</div>
          <div className="box_items">{d.name}</div>
          <div className="box_items">{d.application_id}</div>
          <div className="box_items">{d.vacancy}</div>
          <div className="box_items">{d.contact}</div>


          </div>
        )}
    </div>
  );
}
export default App;
